import React from 'react'

const HourlyList = ({ forcast }) => {
    let threeHourForcast = forcast.map((day, i) => {
        return (
            <div key={i}>
                <h1>{day.dt_txt}</h1>
                <h1>temp: {day.main.temp}</h1>
            </div>
        )
    })
    return (
        <div>
            <div>{threeHourForcast}</div>
        </div>
    )

}

export default HourlyList
